import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import "./App.css";
import DiscordHome from "./projects/Discord app/DiscordHome";
import { login, selectUser, logout } from "./features/counter/userSlice";
import Login from "./common pages/Login";
import { auth } from "./firebase";
import TravelHome from "./projects/travel-advisor/TravelHome";

function App() {
  const dispatch = useDispatch();
  const user = useSelector(selectUser);

  useEffect(() => {
    auth.onAuthStateChanged((authUser) => {
      if (authUser) {
        //user is logged in
        dispatch(
          login({
            uid: authUser.uid,
            photo: authUser.photoURL,
            email: authUser.email,
            displayName: authUser.displayName,
          })
        );
      } else {
        //user is logged out
        dispatch(logout());
      }
    });
  }, [dispatch]);
  return (
    <div className="app">
      {user ? (
        //  <DiscordHome></DiscordHome>
        <Login></Login>
      ) : (
        // <TravelHome></TravelHome>
        <Login></Login>
      )}
    </div>
  );
}

export default App;
